import axios from "axios";

const egyesuletek = "http://localhost:8090/api/egyesulet";

class FajtaService {
  getEgyesuletek() {
    return axios.get(egyesuletek);
  }

  getEgyesuletById(egyesuletId) {
    return axios.get(egyesuletek + "/" + egyesuletId);
  }
  addEgyesulet(egyesulet) {
    return axios.post(egyesuletek + "/save", egyesulet);
  }
  updateEgyesulet(egyesulet) {
    return axios.post(egyesuletek + "/update", egyesulet);
  }
  deleteEgyesulet(egyesuletId) {
    return axios.delete(egyesuletek + "/" + egyesuletId);
  }
}

export default new FajtaService();
